import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Button } from '@mui/material';

export default function BasicTextFields() {
  return (
    <Box
      component="form"
      sx={{
        '& > :not(style)': { m: 1 },
      }}
      noValidate
      autoComplete="off"
    >
      
       <TextField id="outlined-basic" label="Cod " variant="outlined" />
      <TextField id="outlined-basic" label="Coligada" variant="outlined" />
      <Button variant="outlined">Atualizar Situacao</Button>
      <TextField id="outlined-basic" label="Cod. Filial" variant="outlined" />
      <TextField id="outlined-basic" label="Filial" variant="outlined" />
      <TextField id="outlined-basic" label="Setor" variant="outlined" />
      <TextField id="outlined-basic" label="Id Pessoa" variant="outlined" />
      <TextField id="outlined-basic" label="Matricula" variant="outlined" />
      <TextField id="outlined-basic" label="Nome Completo" variant="outlined" />
      <TextField id="outlined-basic" label="E-mail" variant="outlined" />
      <TextField id="outlined-basic" type="password"label="Senha" variant="outlined" />

    </Box>
  );
}
